import React, { Component } from "react";

import {Route,NavLink,HashRouter} from "react-router-dom";
import Search from 'components/search';
import Click from 'components/click';
import Toggle from 'components/toggle';

export default class Main extends Component {
  render() {
    return (
        <HashRouter>
            <div>
                <h1>Simple SPA</h1>
                <ul className="header">
                    <li><NavLink to="/components/search">Search</NavLink></li>
                    <li><NavLink to="/components/click">Click</NavLink></li>
                    <li><NavLink to="/components/toggle">Toggle</NavLink></li>
                </ul>
                <div className="content">
                    <Route path="/components/search" component={Search}/>
                    <Route path="/components/click" component={Click}/>
                    <Route path="/components/click" component={Toggle}/>
                </div>
            </div>
        </HashRouter>
    );
  }
}
